import React  from "react";

export function NavMenuModule({temas}){
    return(
        <React.StrictMode>
            <ul>
                {
                    temas.map(type =>{
                        return(
                            <li>
                                {type.id}
                                <ul>
                                    {
                                        type.sub.temas.map(type => <li>{type}</li>)
                                    }
                                </ul>
                            </li>
                        )
                    })
                }
            </ul>
        </React.StrictMode>
    )
}
